// ThirdPage.js

import React from 'react';
import Footer from './Footer'; // Import Footer component
import Navbar from './Navbar'; // Import Navbar component
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS

const ThirdPage = () => {
  return (
    <div>
      {/* <Navbar /> Include Navbar component */}
      <div className="container">
        <h2>About Me</h2>
        {/* Bootstrap paragraph for information about yourself */}
        <p className="lead">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam in convallis ex. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas.</p>
      </div>
    </div>
  );
};

export default ThirdPage;
